import React from 'react';
import { useNavigate } from 'react-router-dom';
import { ContainerHeader } from './style';
const [page, setPage] = useRequestData('')

export default function Header() {

    const addClient = () => {
        document.getElementById('clientList').style.display = 'none';
        document.getElementById('clientAdd').style.display = 'flex';
        setPage(!page)
    }

    const listClient = () => {
        document.getElementById('clientList').style.display = 'flex';
        document.getElementById('clientAdd').style.display = 'none';
        setPage(!page)
    }

 return (
   <ContainerHeader>
        <div>
            <button onClick={listClient}>Lista</button>
            <button onClick={addClient}>Adicionar</button>
        </div>
   </ContainerHeader>
 );
}
